import react, { useState, setState, useContext } from 'react';
import axios from 'axios';
import { MDBContainer, MDBRow, MDBCol, MDBBtn } from 'mdbreact';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';


function Register() {

    const [user, setUser] = useState({});

    const handleChange = e => {
        setUser({...user, [e.target.name]: e.target.value });
        //console.log(user);
    };

    const hanldeSubmit = e => {
        e.preventDefault();
        axios
                .post('http://localhost:8087/auth/register', { username: user.username , password: user.password, email: user.email })
                .then(data => {
                    console.log(data);
                })
                .catch( e => console.log(e) );
    }

    return(
        <MDBContainer>
            <MDBRow>
                <MDBCol md="6">
                <form onChange={handleChange} onSubmit={hanldeSubmit}>
                    <p className="h4 text-center mb-4">Register</p>
                    <label htmlFor="defaultFormRegisterNameEx" className="grey-text">
                    Your username
                    </label>
                    <input type="text" id="defaultFormRegisterNameEx" className="form-control" name="username"/>
                    <br />
                    <label htmlFor="defaultFormRegisterEmailEx" className="grey-text">
                    Your email
                    </label>
                    <input type="email" id="defaultFormRegisterEmailEx" className="form-control" name="email"/>
                    <br />
                    <label htmlFor="defaultFormRegisterPasswordEx" className="grey-text">
                    Your password
                    </label>
                    <input type="password" id="defaultFormRegisterPasswordEx" className="form-control" name="password"/>
                    <br />
                    <label htmlFor="defaultFormRegisterConfirmEx" className="grey-text">
                    Confirm your password
                    </label>
                    <input type="password" id="defaultFormRegisterConfirmEx" className="form-control" />
                    <div className="text-center mt-4">
                    <MDBBtn color="" type="submit" href="/login">
                        Register
                    </MDBBtn>
                    </div>
                </form>
                </MDBCol>
            </MDBRow>
        </MDBContainer>
    );
